sys_variable_value.value:
(function execute(inputs, outputs) {
  var args = JSON.parse(inputs.args_json)
  outputs.apps = args.apps
  outputs.key_attributes = args.key_atts
  outputs.properties = args.prop
  outputs.armis_device_id = parseInt(args.id)
})(inputs, outputs);

